import React from 'react';
import { Grid, Typography } from '@material-ui/core';

const HomeTestimonial = () => {
    return (
        <div>
            <div className="mycontainer">
                <Typography variant="h1">
                    گیت؟
                </Typography>
                <Typography variant="subtitle1">
                    گیت؟
                </Typography>
                
            </div>
        </div>
    )
}

export default HomeTestimonial;
